import React, { useState } from "react";
import './App.css'; 

export default function App() {
  const [ticker, setTicker] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");
  const [riskLevel, setRiskLevel] = useState("medium");
  const [recommendation, setRecommendation] = useState(null);
  const [error, setError] = useState("");

  
  const currentYear = new Date().getFullYear();
  const years = Array.from({ length: currentYear - 2000 + 1 }, (_, index) => currentYear - index); // Descending years

  const handleSubmit = async () => {
    setError("");
    try {
      const response = await fetch("http://localhost:8000/recommend", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          ticker,
          start_date: startDate,
          end_date: endDate,
          risk_level: riskLevel,
        }),
      });

      if (!response.ok) {
        throw new Error(`Error: ${response.statusText}`);
      }

      const data = await response.json();

      if (data && data.ticker) {
        setRecommendation(data);
      } else {
        setError("‚ùå Invalid response from server");
        setRecommendation(null);
      }
    } catch (error) {
      console.error("Error during fetch:", error);
      setError(`‚ùå ${error.message}`);
      setRecommendation(null);
    }
  };

  return (
    <div className="container">
      <h1>Stock Market Recommendation System üìà</h1>
      <div className="form">
        <input
          type="text"
          placeholder="Ticker (e.g., TSLA) üìä"
          value={ticker}
          onChange={(e) => setTicker(e.target.value)}
        />
        <div className="date-selector">
          <select
            value={startDate.split("-")[0] || ""}
            onChange={(e) => setStartDate(e.target.value + "-" + startDate.split("-")[1] + "-" + startDate.split("-")[2])}
          >
            {years.map((year) => (
              <option key={year} value={year}>
                {year}
              </option>
            ))}
          </select>
          <input
            type="month"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
          />
        </div>
        <div className="date-selector">
          <select
            value={endDate.split("-")[0] || ""}
            onChange={(e) => setEndDate(e.target.value + "-" + endDate.split("-")[1] + "-" + endDate.split("-")[2])}
          >
            {years.map((year) => (
              <option key={year} value={year}>
                {year}
              </option>
            ))}
          </select>
          <input
            type="month"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
          />
        </div>
        <select
          value={riskLevel}
          onChange={(e) => setRiskLevel(e.target.value)}
        >
          <option value="low">Low Risk üòå</option>
          <option value="medium">Medium Risk ‚öñÔ∏è</option>
          <option value="high">High Risk ‚ö°</option>
        </select>
        <button onClick={handleSubmit}>Get Recommendation üöÄ</button>
      </div>

      {error && <div className="error">{error}</div>}

      {recommendation && (
        <div className="result">
          <h3>Recommendation for {recommendation.ticker} üìä</h3>
          <p>
            Average Return: {(recommendation.average_return * 100).toFixed(2)}% üìà
          </p>
          <p>
            Volatility: {(recommendation.volatility * 100).toFixed(2)}% üå™Ô∏è
          </p>
          <p>
            {recommendation.manipulated
              ? "‚ö†Ô∏è Potential Manipulation Detected"
              : "‚úÖ No Manipulation Detected"}
          </p>
        </div>
      )}
    </div>
  );
}
